import React, { useState, useEffect } from 'react';
import {
  deleteUser,
  deleteBlogPost,
  deletePreMedicalForm,
  deleteComment,
  getAllUsers,
  getPatientBlogPosts,
  getPatientSymptoms,
  getComments,
} from '../../apiService';
import './AdminDashboard.css'; 

const AdminDashboard = () => {
  const [users, setUsers] = useState([]);
  const [blogPosts, setBlogPosts] = useState([]);
  const [symptoms, setSymptoms] = useState([]);
  const [comments, setComments] = useState([]);

  const fetchData = async () => {
    try {
      const usersData = await getAllUsers();
      const blogPostsData = await getPatientBlogPosts();
      const symptomsData = await getPatientSymptoms();
      const commentsData = await getComments(blogPostsData.map((post) => post.id));

      setUsers(usersData);
      setBlogPosts(blogPostsData);
      setSymptoms(symptomsData);
      setComments(commentsData);
    } catch (error) {
      console.error('Error fetching initial data:', error);
    }
  };

  const handleDeleteUser = async (userId) => {
    try {
      await deleteUser(userId);
      fetchData();
    } catch (error) {
      console.error('Error deleting user:', error);
    }
  };

  const handleDeleteBlogPost = async (blogPostId) => {
    try {
      await deleteBlogPost(blogPostId);
      fetchData();
    } catch (error) {
      console.error('Error deleting blog post:', error);
    }
  };

  const handleDeletePreMedicalForm = async (formId) => {
    try {
      await deletePreMedicalForm(formId);
      fetchData();
    } catch (error) {
      console.error('Error deleting pre-medical form:', error);
    }
  };

  const handleDeleteComment = async (commentId, blogPostId) => {
    try {
      await deleteComment(commentId);
      fetchData();
    } catch (error) {
      console.error('Error deleting comment:', error);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="admin-dashboard-container">
      <h2 className="text-center">Admin Dashboard</h2>
      <button className="btn btn-primary" onClick={fetchData}>
        Refresh Data
      </button>

      <div className="box-container">
        <div className="user-box box">
          <h3>Users</h3>
          <ul>
            {users.map((user) => (
              <li key={user.id}>
                {user.username} -{' '}
                <button className="btn btn-danger" onClick={() => handleDeleteUser(user.id)}>
                  Delete
                </button>
              </li>
            ))}
          </ul>
        </div>

        <div className="blog-post-box box">
          <h3>Blog Posts</h3>
          <ul>
            {blogPosts.map((post) => (
              <li key={post.id}>
                {post.title} -{' '}
                <button className="btn btn-danger" onClick={() => handleDeleteBlogPost(post.id)}>
                  Delete
                </button>
              </li>
            ))}
          </ul>
        </div>

        <div className="premedical-form-box box">
          <h3>Symptoms</h3>
          <ul>
            {symptoms.map((symptom) => (
              <li key={symptom.id}>
                {symptom.symptoms} -{' '}
                <button className="btn btn-danger" onClick={() => handleDeletePreMedicalForm(symptom.id)}>
                  Delete
                </button>
              </li>
            ))}
          </ul>
        </div>

        <div className="comments-box box">
          <h3>Comments</h3>
          <ul>
            {comments.map((comment) => (
              <li key={comment.id}>
                {comment.content} -{' '}
                <button className="btn btn-danger" onClick={() => handleDeleteComment(comment.id, comment.blog_post)}>
                  Delete
                </button>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
